import React from 'react';
import './Scouting.css';
import Position from '../../img/Position/Top.png';
import imageRank from '../../img/Rank/Season_2019_-_Gold_3.png';
import MVB from './MVB';
import Garen from '../../img/Champion/GarenSquare.png';
import Gnar from '../../img/Champion/GnarSquare.png';
import Lulu from '../../img/Champion/LuluSquare.png';
import Tryndamere from '../../img/Champion/TryndamereSquare.png';
import Data from './dataScouting.json';


const listItems = Data.map(item =>
    <div id="border">
        <div id="SummonerName">
            {Data.summonerName}
        </div>
        <div id="positionRank">
            <img src={Data.imgMainPosition} id="PosImg" />
            <img src={Data.rank.imgRank} id="RankImg" />
            <div id="textRank">
                <div id="rankName">{Data.rank.rankName}</div>
                <div id="LP">{Data.rank.LP} LP</div>
                <div id="winLose">
                    {Data.rank.win}W {Data.rank.lose}L
                                <div id="winrate">
                        {Data.rank.winrate}%
                                </div>
                </div>
            </div>
        </div>
        <div id="mostValuableBans">
            <div id="mvbTitle">MOST VALUABLE BANS</div>
            <div id="MVBContainer">
                <div className="line">
                    <MVB bans={Data.Bans[0]} />
                    <MVB bans={Data.Bans[2]} />
                </div>
                <div className="line">
                    <MVB bans={Data.Bans[1]} />
                    <MVB bans={Data.Bans[3]} />
                </div>
            </div>
        </div>
    </div>
);


class Scouting extends React.Component {



    render() {
        return (
            <div id="Scouting">
                <h1>SCOUTING</h1>
                {listItems}
            </div>
        );
    }
}



export default Scouting;
